import React from "react";
import Slots from "./Slots";

const Lost = () => {
    let x = Slots.x;
    let y = Slots.y;
    let z = Slots.z;

    return (
        <>
            <div className="slot_inner">
                <h1>{x}{y}{z}</h1>
                <h1>You have LOST</h1>
                <hr></hr>
            </div>
        </>
    )
}

export default Lost;
